-- Jmp hook
local jmp_hook = {hooks = {}}

function jmp_hook.new(cast, callback, hook_addr, size)
    local size = size or 5
    local new_hook = {}
    local detour_addr = tonumber(ffi.cast('intptr_t', ffi.cast('void*', ffi.cast(cast, callback))))
    local void_addr = ffi.cast('void*', hook_addr)
    local old_prot = ffi.new('unsigned long[1]')
    local org_bytes = ffi.new('uint8_t[?]', size)
    ffi.copy(org_bytes, void_addr, size)
    local hook_bytes = ffi.new('uint8_t[?]', size, 0x90)
    hook_bytes[0] = 0xE9
    ffi.cast('uint32_t*', hook_bytes + 1)[0] = detour_addr - hook_addr - 5
    new_hook.call = ffi.cast(cast, hook_addr)
    new_hook.status = false
    local function set_status(bool)
        new_hook.status = bool
        ffi.C.VirtualProtect(void_addr, size, 0x40, old_prot)
        ffi.copy(void_addr, bool and hook_bytes or org_bytes, size)
        ffi.C.VirtualProtect(void_addr, size, old_prot[0], old_prot)
    end
    new_hook.stop = function() set_status(false) end
    new_hook.start = function() set_status(true) end
    new_hook.start()
    table.insert(jmp_hook.hooks, new_hook)
    return setmetatable(new_hook, {
        __call = function(self, ...)
            self.stop()
            local res = self.call(...)
            self.start()
            return res
        end
    })
end

-- Квадратный радар
function limitRadarPoint(point)
    local sr = math.sqrt(point.y * point.y + point.x * point.x)
    local x = 0.0
    if sr > 1.0 then
        if point.x > -1.0 and point.x < 1.0 and point.y > -1.0 and point.y < 1.0 then
            return 0.99
        end
        local y = math.atan2(point.y, point.x)
        local angle = y * 57.295779513
        if angle > 45.0 or angle <= -45.0 then
            if angle > 45.0 and angle <= 135.0 then
                point.x = math.cos(angle / 57.295779513) * 1.4142135623
                point.y = 1.0
                return sr
            end
            if angle <= 135.0 and angle > -135.0 then
                point.x = math.cos(angle / 57.295779513) * 1.4142135623
                point.y = -1.0
                return sr
            end
            x = -1.0
        else
            x = 1.0
        end
        point.x = x
        point.y = math.sin(angle / 57.295779513) * 1.4142135623
    end
    return sr
end

