    while not isSampAvailable() do wait(100) end
    imgui.ShowNotification(thisScript().name, 1, 'Загружен!\nКоманда: /'..u8:decode(mainIni.menu.settings_menu_command)..'\nАвтор: '..table.concat(thisScript().authors, ', ')..'\nВерсия: '..thisScript().version, 10)
