        -- Процесс ImGui
        imgui.Process = true
        -- Показ курсора
        imgui.ShowCursor = settings_menu_state.v or scoreboard_active_state.v
        -- Выключение курсора при смене позиции
        if change_position then
            sampSetCursorMode(4)
        end
        -- Состояние обычного худа
        displayHud(standart_hud_state.v)
        -- Позиция радара
        changeRadarPosition(radar_position_x, radar_position_y)
        -- Размер радара
        changeRadarSize(radar_size_x.v, radar_size_y.v)
        -- Прозрачность знака севера
        memory.setuint8(0x588180, radar_north_alpha.v * 2.55, true)
        -- Прозрачность обводки радара
        changeRadarAlpha(radar_border_alpha.v)
        -- Форма радара
        if radar_form.v == 2 then
            radar_hook.start()
            local pointer_to_value = ffi.new('float[1]')
            pointer_to_value[0] = 0.000001
            ffi.cast('float***', ffi.cast('void*', 0x58585C))[0][0] = pointer_to_value
        else
            radar_hook.stop()
            memory.setfloat(0x858F1C, 0.261, true)
        end
        -- Онлайн за день
        time_of_online_date = os.date('%D')
        time_of_online = mainIni.information_window.time_of_online + os.clock()
        -- Сброс онлайна за день
        if os.date('%D') ~= mainIni.information_window.time_of_online_date then
            mainIni.information_window.time_of_online_date = os.date('%D')
            if sampIsLocalPlayerSpawned() then
                mainIni.information_window.time_of_online = 0 - os.clock()
            else
                mainIni.information_window.time_of_online = 0
            end
            inicfg.save(mainIni, ini_config_file)
        end
        -- Онлайн за сессию
        session_online = os.clock()
        -- Состояние обычного прицела
        setCrosshairActive(standart_crosshair_state.v)
        -- Прозрачность стандартного прицела
        changeCrosshairAlpha(standart_crosshair_alpha.v)
        if not isPauseMenuActive() then
            -- Кастомный прицел
            if custom_crosshair_state.v and memory.getuint32(0xB6F028 + 0x174 + 12 + memory.getuint8(0xB6F028 + 0x59) * 0x238) == 53 or memory.getuint32(0xB6F028 + 0x174 + 12 + memory.getuint8(0xB6F028 + 0x59) * 0x238) == 55 then
                local crosshair_x, crosshair_y = convertGameScreenCoordsToWindowScreenCoords(339, 179)
                renderDrawLine(crosshair_x + 3, crosshair_y - 9, crosshair_x + 3, crosshair_y + 12, 3, joinArgb(color_custom_crosshair.v[1], color_custom_crosshair.v[2], color_custom_crosshair.v[3], color_custom_crosshair.v[4]))
                renderDrawLine(crosshair_x - 10, crosshair_y, crosshair_x + 13, crosshair_y, 3, joinArgb(color_custom_crosshair.v[1], color_custom_crosshair.v[2], color_custom_crosshair.v[3], color_custom_crosshair.v[4]))
            end
            -- Виджет "Дата и время"
            if date_and_time_state.v then
                if date_and_time_time_state.v then
                    renderFontDrawText(date_and_time_font_one, os.date('%H:%M:%S'), date_and_time_position_x, date_and_time_position_y, joinArgb(color_date_and_time.v[1], color_date_and_time.v[2], color_date_and_time.v[3], color_date_and_time.v[4]))
                end
                if date_and_time_date_state.v then
                    renderFontDrawText(date_and_time_font_two, tonumber(os.date('%d', os.time()))..' '..getStrMonth()..' '..tonumber(os.date('20%y', os.time()))..' г., '..getStrWeekDay(), date_and_time_position_x, date_and_time_time_state.v and date_and_time_position_y + date_and_time_size.v * 1.5 or date_and_time_position_y, joinArgb(color_date_and_time.v[1], color_date_and_time.v[2], color_date_and_time.v[3], color_date_and_time.v[4]))
                end
            end
            -- Виджет "Кадры в секунду"
            if frames_per_second_state.v and frames_per_second_active_state then
                renderFontDrawText(frames_per_second_font, math.floor(imgui.GetIO().Framerate), frames_per_second_position_x, frames_per_second_position_y, joinArgb(color_frames_per_second.v[1], color_frames_per_second.v[2], color_frames_per_second.v[3], color_frames_per_second.v[4]))
            end
        end
    end
