-- Отрисовка ImGui
function imgui.OnDrawFrame()
    style_and_theme()
    if settings_menu_state.v then
        settings_menu_elements()
    end
    notification_elements()
    if memory.getint32(memory.getuint32(getModuleHandle('samp.dll') + 0x21A0E4) + 0x8) ~= 0 and not sampIsScoreboardOpen() and not isKeyDown(0x74) then
        if custom_hud_state.v and sampIsLocalPlayerSpawned() then
            hud_elements()
        end
        if speedometer_state.v and isCharInAnyCar(PLAYER_PED) then
            speedometer_elements()
        end
    end
    if information_window_state.v then
        information_window_elements()
    end
    if scoreboard_active_state.v then
        scoreboard_elements()
    end
end

