function settings_menu_elements()
    imgui.SetNextWindowPos(imgui.ImVec2(sx / 2, sy / 2), imgui.Cond.FirstUseEver, imgui.ImVec2(0.5, 0.5))
    imgui.SetNextWindowSize(imgui.ImVec2(750, 400), imgui.Cond.FirstUseEver)
    imgui.Begin('##SettingsMenu', _, imgui.WindowFlags.NoResize + imgui.WindowFlags.NoTitleBar + imgui.WindowFlags.NoScrollbar + imgui.WindowFlags.NoScrollWithMouse + imgui.WindowFlags.NoCollapse)
    local position = imgui.GetCursorScreenPos()
    imgui.PushFont(main_font_one)
    if script_information_window.v then
        imgui.OpenPopup('##ScriptInformationWindow')
        imgui.SetNextWindowSize(imgui.ImVec2(400, 360), imgui.Cond.FirstUseEver)
        if imgui.BeginPopupModal('##ScriptInformationWindow', _, imgui.WindowFlags.NoTitleBar + imgui.WindowFlags.NoResize + imgui.WindowFlags.NoCollapse) then
            local position = imgui.GetCursorScreenPos()
            imgui.GetWindowDrawList():AddRectFilled(position, imgui.ImVec2(position.x + 400, position.y + 28), imgui.GetColorU32(imgui.ImVec4(0.00, 0.00, 0.00, 1.00)))
            imgui.GetWindowDrawList():AddRect(position, imgui.ImVec2(position.x + 400, position.y + 360), imgui.GetColorU32(imgui.GetStyle().Colors[imgui.Col.Border]))
            if list_script_information_window.v == 1 then
