    imgui.SetCursorPosY(160)
    if imgui.CButton('Изменить позицию##Hud', imgui.ImVec2(140, 27)) then
        if custom_hud_state.v and sampIsLocalPlayerSpawned() then
            lua_thread.create(function()
                change_position = true
                settings_menu_state.v = false
                imgui.ShowNotification('Худ', 2, 'Чтобы сохранить позицию\nнажмите на клавишу "Enter"\n(а чтобы отменить - на "Escape")', 5)
                while change_position do
                    local curx, cury = getCursorPos()
                    hud_position_x, hud_position_y = curx, cury
                    if isKeyDown(0x0D) then
                        mainIni.hud.hud_position_x, mainIni.hud.hud_position_y = hud_position_x, hud_position_y
                        if inicfg.save(mainIni, ini_config_file) then
                            imgui.ShowNotification('Худ', 2, 'Позиция сохранена!\nX: '..hud_position_x..', Y: '..hud_position_y, 5)
                            break
                        end
                    elseif isKeyDown(0x1B) then
                        hud_position_x, hud_position_y = mainIni.hud.hud_position_x, mainIni.hud.hud_position_y
                        imgui.ShowNotification('Худ', 2, 'Вы отменили изменение\nпозиции', 5)
                        break
                    end
                    wait(0)
                end
            end)
        else
            imgui.ShowNotification('Худ', 2, custom_hud_state.v and 'Вы должны заспавниться!' or 'У вас отключен кастомный худ', 5)
