function radar_settings_elements()
    imgui.SetWindowFontScale(0.6)
    imgui.Text(u8'Основное')
    imgui.SetWindowFontScale(0.45)
    imgui.SetCursorPosY(35)
    imgui.Text(u8'Выберите форму радара.')
