        mainIni.radar.radar_form = radar_form.v
        inicfg.save(mainIni, ini_config_file)
    end
    imgui.SetCursorPosY(145)
    imgui.Text(u8'Нажмите, чтобы изменить позицию радара.')
    imgui.SetCursorPosY(170)
    if imgui.CButton('Изменить позицию##Radar', imgui.ImVec2(140, 27)) then
        if sampIsLocalPlayerSpawned() then
            lua_thread.create(function()
                change_position = true
                settings_menu_state.v = false
                imgui.ShowNotification('Радар', 3, 'Чтобы сохранить позицию\nнажмите на клавишу "Enter"\n(а чтобы отменить - на "Escape")', 5)
                while change_position do
                    local curx, cury = getCursorPos()
                    local gcurx, gcury = convertWindowScreenCoordsToGameScreenCoords(curx, cury)
                    local gsw, gsh = convertWindowScreenCoordsToGameScreenCoords(sx, sy)
                    radar_position_x, radar_position_y = gcurx, gsh - gcury
                    if isKeyDown(0x0D) then
                        mainIni.radar.radar_position_x, mainIni.radar.radar_position_y = radar_position_x, radar_position_y
                        if inicfg.save(mainIni, ini_config_file) then
                            imgui.ShowNotification('Радар', 3, 'Позиция сохранена!\nX: '..curx..', Y: '..cury, 5)
                            break
                        end
                    elseif isKeyDown(0x1B) then
                        radar_position_x, radar_position_y = mainIni.radar.radar_position_x, mainIni.radar.radar_position_y
                        imgui.ShowNotification('Радар', 3, 'Вы отменили изменение\nпозиции', 5)
                        break
                    end
                    wait(0)
                end
            end)
        else
