-- ImGui уведомления
function notification_elements()
    local notification_count = 0
	for k, v in ipairs(notification_message) do
        if v.active and v.time < os.clock() then
            v.active = false
        end
        if v.time + 3 < os.clock() then
            notification_state.v = false
        end
		if notification_count < 3 then
			if not v.active then
                if v.notf_time_one > 0 then
                    notification_state.v = true
                    v.active = true
					v.time = os.clock() + v.notf_time_one
					v.notf_time_one = 0
				end
			end
            if v.active then
                notification_count = notification_count + 1
                imgui.PushStyleColor(imgui.Col.WindowBg, imgui.GetStyle().Colors[imgui.Col.PopupBg])
				if v.time - 0.5 <= os.clock() then
                    notification_settings.position.x = gsx - (v.time - os.clock()) * 624
                elseif v.time - (v.notf_time_two - 0.5) >= os.clock() then
                    notification_settings.position.x = (gsx - 312) + ((v.time - (v.notf_time_two - 0.5)) - os.clock()) * 624
                else
                    notification_settings.position.x = gsx - 312
                end
                notification_settings.position = imgui.ImVec2(notification_settings.position.x, notification_settings.position.y - (notification_settings.size.y + (count == 1 and 8 or 13)))
				imgui.SetNextWindowPos(notification_settings.position, _, imgui.ImVec2(0, 0))
				imgui.SetNextWindowSize(imgui.ImVec2(notification_settings.size.x, notification_settings.size.y))
                imgui.Begin('##'..k, _, imgui.WindowFlags.NoResize + imgui.WindowFlags.NoTitleBar + imgui.WindowFlags.NoMove + imgui.WindowFlags.NoCollapse + imgui.WindowFlags.NoFocusOnAppearing)
                imgui.PushFont(main_font_one)
                local DrawList = imgui.GetWindowDrawList()
                local position = imgui.GetCursorScreenPos()
                imgui.SetCursorPos(imgui.ImVec2(25, 25))
                if v.image_id == 1 then
                    imgui.Image(small_logo_image, imgui.ImVec2(40, 40))
                elseif v.image_id == 2 then
                    imgui.Image(hud_image, imgui.ImVec2(40, 40))
                elseif v.image_id == 3 then
                    imgui.Image(radar_image, imgui.ImVec2(40, 40))
                elseif v.image_id == 4 then
                    imgui.Image(speedometer_image, imgui.ImVec2(40, 40))
                elseif v.image_id == 5 then
                    imgui.Image(scoreboard_image, imgui.ImVec2(40, 40))
                elseif v.image_id == 6 then
                    imgui.Image(information_window_image, imgui.ImVec2(40, 40))
                elseif v.image_id == 7 then
                    imgui.Image(time_image, imgui.ImVec2(40, 40))
                elseif v.image_id == 8 then
                    imgui.Image(frames_per_second_image, imgui.ImVec2(40, 40))
                elseif v.image_id == 9 then
                    local position1 = imgui.GetCursorScreenPos()
                    local position2 = imgui.GetCursorPos()
                    DrawList:AddLine(position1, imgui.ImVec2(position1.x, position1.y + 30), imgui.GetColorU32(imgui.ImVec4(1.00, 1.00, 1.00, 1.00)), 2)
                    DrawList:AddLine(position1, imgui.ImVec2(position1.x + 40, position1.y - 4), imgui.GetColorU32(imgui.ImVec4(1.00, 1.00, 1.00, 1.00)), 2)
