                DrawList:AddRectFilled(imgui.ImVec2(position.x, position.y + 150), imgui.ImVec2(position.x + (v.time - os.clock()) * (notification_settings.size.x / v.notf_time_two), position.y + 153), imgui.GetColorU32(imgui.ImVec4(1.00, 1.00, 1.00, 1.00)))
                imgui.PopFont()
                imgui.End()
                imgui.PopStyleColor()
			end
		end
	end
	notification_settings = {
		position = {
			x = gsx - 312,
			y = gsy + 20
		},
		size = {
			x = 320,
			y = 153
		}
	}
end

