function imgui.DrawPlayerInScoreboard(id)
    local is_ped_in_stream, ped = sampGetCharHandleBySampPlayerId(id)
    local _, local_player_id = sampGetPlayerIdByCharHandle(PLAYER_PED)
    local player_color = sampGetPlayerColor(id)
    local r_player_color, g_player_color, b_player_color = bitex.bextract(player_color, 16, 8), bitex.bextract(player_color, 8, 8), bitex.bextract(player_color, 0, 8)
    local player_nick = sampGetPlayerNickname(id)
    local distance_to_player = getDistanceToPlayer(id)
    local is_player_paused = sampIsPlayerPaused(id)
    local player_score = sampGetPlayerScore(id)
    local player_ping = sampGetPlayerPing(id)
    player_count = player_count + 1
    if imgui.Selectable('##'..id, id == selected_id, imgui.SelectableFlags.SpanAllColumns + imgui.SelectableFlags.AllowDoubleClick) then
        if imgui.IsMouseDoubleClicked(0) then
            sampSendClickPlayer(id, 0)
            scoreboard_active_state.v = false
        else
            selected_id = selected_id == id and -1 or id
        end
    end
    imgui.ScoreboardShowHint('Кликните правой кнопкой мыши, чтобы открыть меню.')
    imgui.PushStyleVar(imgui.StyleVar.WindowPadding, imgui.ImVec2(5, 5))
    if imgui.BeginPopupContextItem() then
        selected_id = id
        if not is_ped_in_stream or not (scoreboard_player_health_state.v or scoreboard_player_armour_state.v or scoreboard_player_skin_state.v or scoreboard_player_weapon_state.v or scoreboard_player_direction_state.v or scoreboard_player_distance_state.v or scoreboard_player_location_state.v or scoreboard_player_square_state.v or scoreboard_player_coordinates_state.v or scoreboard_car_name_and_model_id_state.v or scoreboard_car_server_id_state.v or scoreboard_car_health_state.v or scoreboard_car_speed_state.v or scoreboard_car_colours_state.v or scoreboard_car_engine_state.v or scoreboard_car_lights_state.v or scoreboard_car_doors_state.v) then
