            elseif getCityPlayerIsIn(ped) == 2 and not player_street:find('San Fierro') and player_street ~= 'Неизвестно' then
                player_city = ' San Fierro, '
            elseif getCityPlayerIsIn(ped) == 3 and not player_street:find('Las Venturas') and player_street ~= 'Неизвестно' then
