            end
            if scoreboard_car_speed_state.v then
                imgui.CenterText('Скорость т/с: '..car_speed)
            end
            if scoreboard_car_colours_state.v then
                imgui.CenterText('Цвета т/с: '..(isCharInAnyCar(ped) and car_color_one..', '..car_color_two or '-'))
            end
            if scoreboard_car_engine_state.v then
                imgui.CenterText('Двигатель: '..(isCharInAnyCar(ped) and (car_engine_is_on and 'Заведен' or 'Не заведен') or '-'))
