            if scoreboard_car_lights_state.v then
                imgui.CenterText('Фары: '..(isCharInAnyCar(ped) and (car_lights_is_on and 'Включены' or 'Выключены') or '-'))
            end
            if scoreboard_car_doors_state.v then
                imgui.CenterText('Двери: '..(isCharInAnyCar(ped) and (car_doors_is_open and 'Открыты' or 'Закрыты') or '-'))
            end
            imgui.PopStyleVar()
            local position = imgui.GetCursorPos()
            imgui.SetCursorPos(imgui.ImVec2(width / 2 - 25, position.y + 7))
            if imgui.Button(u8'Назад', imgui.ImVec2(50, 20)) then
                list_scoreboard_menu.v = 1
            end
        end
        imgui.EndPopup()
    end
    imgui.PopStyleVar()
    imgui.SameLine()
    imgui.Text(tostring(id))
    imgui.SetColumnWidth(0, 35)
    imgui.NextColumn()
    imgui.TextColored(imgui.ImVec4(r_player_color / 255, g_player_color / 255, b_player_color / 255, color_scoreboard_text.v[4]), player_nick)
    imgui.SetColumnWidth(-1, (scoreboard_in_stream_toggle_button.v and scoreboard_in_stream_players_state.v) and 375 or 520)
    imgui.NextColumn()
    if scoreboard_in_stream_toggle_button.v and scoreboard_in_stream_players_state.v then
        imgui.Text(id == local_player_id and '-' or u8(is_player_paused and 'Да' or 'Нет'))
