        imgui.NextColumn()
        imgui.Text(id == local_player_id and '-' or distance_to_player)
        imgui.SetColumnWidth(-1, 72.5)
        imgui.NextColumn()
    end
    imgui.Text(tostring(player_score))
    imgui.SetColumnWidth(-1, 72.5)
    imgui.NextColumn()
    imgui.Text(tostring(player_ping))
    imgui.SetColumnWidth(-1, 72.5)
    imgui.NextColumn()
