function imgui.Updater()
    local DrawList = imgui.GetWindowDrawList()
    local position1 = imgui.GetCursorScreenPos()
    local position2 = imgui.GetCursorPos()
    DrawList:AddLine(position1, imgui.ImVec2(position1.x, position1.y + 30), imgui.GetColorU32(imgui.ImVec4(1.00, 1.00, 1.00, 1.00)), 2)
    DrawList:AddLine(position1, imgui.ImVec2(position1.x + 40, position1.y - 4), imgui.GetColorU32(imgui.ImVec4(1.00, 1.00, 1.00, 1.00)), 2)
    DrawList:AddLine(imgui.ImVec2(position1.x + 40, position1.y - 4), imgui.ImVec2(position1.x + 40, position1.y + 35), imgui.GetColorU32(imgui.ImVec4(1.00, 1.00, 1.00, 1.00)), 2)
    DrawList:AddLine(imgui.ImVec2(position1.x, position1.y + 30), imgui.ImVec2(position1.x + 41, position1.y + 35), imgui.GetColorU32(imgui.ImVec4(1.00, 1.00, 1.00, 1.00)), 2)
    if updater_state == 1 or updater_state == 2 then
        circle_color = imgui.ImVec4(0.80, 0.80, 0.00, 1.00)
    elseif updater_state == 3 or updater_state == 4 then
        circle_color = imgui.ImVec4(0.00, 0.80, 0.00, 1.00)
    else
        circle_color = imgui.ImVec4(0.80, 0.00, 0.00, 1.00)
    end
    DrawList:AddCircleFilled(imgui.ImVec2(position1.x + 37, position1.y + 32), 10, imgui.GetColorU32(circle_color), 20)
    if updater_state == 1 or updater_state == 3 then
        imgui.SetCursorPos(imgui.ImVec2(position2.x + 32, position2.y + 27))
        imgui.Image(refresh_arrows_image, imgui.ImVec2(10, 10))
    elseif updater_state == 2 or updater_state == 5 then
        DrawList:AddRectFilled(imgui.ImVec2(position1.x + 35.5, position1.y + 25), imgui.ImVec2(position1.x + 38.5, position1.y + 28), imgui.GetColorU32(imgui.ImVec4(1.00, 1.00, 1.00, 1.00)))
        DrawList:AddRectFilled(imgui.ImVec2(position1.x + 35.5, position1.y + 29), imgui.ImVec2(position1.x + 38.5, position1.y + 39), imgui.GetColorU32(imgui.ImVec4(1.00, 1.00, 1.00, 1.00)))
    else
        DrawList:AddLine(imgui.ImVec2(position1.x + 31, position1.y + 33), imgui.ImVec2(position1.x + 37, position1.y + 37), imgui.GetColorU32(imgui.ImVec4(1.00, 1.00, 1.00, 1.00)), 2)
        DrawList:AddLine(imgui.ImVec2(position1.x + 37, position1.y + 35), imgui.ImVec2(position1.x + 43, position1.y + 28), imgui.GetColorU32(imgui.ImVec4(1.00, 1.00, 1.00, 1.00)), 2)
    end
    imgui.SetCursorPos(imgui.ImVec2(position2.x + 8, position2.y + 3))
    imgui.Image(refresh_arrows_image, imgui.ImVec2(24, 24))
    imgui.SetCursorPos(imgui.ImVec2(position2.x + 55, position2.y - 5))
    imgui.BeginGroup()
    imgui.SetWindowFontScale(0.45)
    imgui.Text(u8(updater_text))
    if updater_spinner and updater_state ~= 5 then
        imgui.Spinner()
    end
    if updater_state == 2 then
        if imgui.TextButton('Установить обновление') then
            update_script = true
        end
    elseif updater_state == 5 then
        if imgui.TextButton('Повторить попытку') then
            checkUpdate()
        end
    end
    imgui.EndGroup()
end

function imgui.Spinner()
    local style = imgui.GetStyle()
    local DrawList = imgui.GetWindowDrawList()
    local position = imgui.GetCursorScreenPos()
    local radius = 10
    local size = imgui.ImVec2(radius * 2, (radius + style.FramePadding.y) * 2)
    imgui.Dummy(imgui.ImVec2(size.x + style.ItemSpacing.x, size.y))
    DrawList:PathClear()
    local num_segments = 30
    local start = math.abs(math.sin(imgui.GetTime() * 1.8) * (num_segments - 5))
    local a_min = 3.14 * 2.0 * start / num_segments
    local a_max = 3.14 * 2.0 * (num_segments - 3) / num_segments
    local centre = imgui.ImVec2(position.x + radius, position.y + radius + style.FramePadding.y)
    for i = 0, num_segments do
        DrawList:PathLineTo(imgui.ImVec2(centre.x + math.cos(a_min + (i / num_segments) * (a_max - a_min) + imgui.GetTime() * 8) * radius, centre.y + math.sin(a_min + (i / num_segments) * (a_max - a_min) + imgui.GetTime() * 8) * radius))
    end
    DrawList:PathStroke(imgui.GetColorU32(imgui.ImVec4(0.00, 0.47, 0.84, 1.00)), false, 3)
end

