function imgui.CSlider(name, int, min, max)
    local DrawList = imgui.GetWindowDrawList()
    local position1 = imgui.GetCursorScreenPos()
    local position2 = imgui.GetCursorPos()
    local cx, cy = getCursorPos()
    local width = 250
    local is_slider_active = false
    imgui.SetCursorPosY(position2.y - 11)
    imgui.InvisibleButton(name, imgui.ImVec2(width, 24))
    if imgui.IsItemHovered() then
        color_slider = imgui.ImVec4(0.95, 0.95, 0.95, 1.00)
        if imgui.IsItemActive() then
            color_bg = imgui.ImVec4(0.40, 0.40, 0.40, 1.00)
        else
            color_bg = imgui.ImVec4(0.60, 0.60, 0.60, 1.00)
        end
    else
        color_slider = imgui.ImVec4(0.00, 0.47, 0.84, 1.00)
        color_bg = imgui.ImVec4(0.40, 0.40, 0.40, 1.00)
    end
    DrawList:AddRectFilled(position1, imgui.ImVec2(position1.x + width, position1.y + 2), imgui.GetColorU32(color_bg))
    DrawList:AddRectFilled(position1, imgui.ImVec2(position1.x + width / ((max - min) / int.v), position1.y + 2), imgui.GetColorU32(imgui.ImVec4(0.00, 0.47, 0.84, 1.00)))
    DrawList:AddRectFilled(imgui.ImVec2((position1.x + width / ((max - min) / int.v)) - 3, position1.y - 11), imgui.ImVec2(position1.x + width / ((max - min) / int.v) + 3, position1.y + 13), imgui.GetColorU32(color_slider), 30)
    for i = 0, (max - min) do
        if cx >= (position1.x + i * width / (max + 1)) and cx <= (position1.x + (i + 1) * width / (max + 1)) and cy > position1.y - 11 and cy < position1.y + 13 and imgui.IsMouseDown(0) then
            is_slider_active = true
            DrawList:AddRectFilled(imgui.ImVec2((position1.x + width / ((max - min) / int.v)) - 15, position1.y - 45), imgui.ImVec2((position1.x + width / ((max - min) / int.v)) + 16, position1.y - 20), imgui.GetColorU32(imgui.ImVec4(0.17, 0.17, 0.17, 1.00)))
            DrawList:AddRect(imgui.ImVec2((position1.x + width / ((max - min) / int.v)) - 15, position1.y - 45), imgui.ImVec2((position1.x + width / ((max - min) / int.v)) + 16, position1.y - 20), imgui.GetColorU32(imgui.ImVec4(0.10, 0.10, 0.10, 1.00)), 0, 0, 2)
            local size_int = imgui.CalcTextSize(tostring(int.v))
            imgui.SetCursorPos(imgui.ImVec2((position2.x + width / ((max - min) / int.v)) - size_int.x / 2, position2.y - 43))
            imgui.SetWindowFontScale(0.45)
            imgui.Text(tostring(int.v))
            DrawList:AddRectFilled(imgui.ImVec2((position1.x + width / ((max - min) / int.v)) - 3, position1.y - 11), imgui.ImVec2(position1.x + width / ((max - min) / int.v) + 3, position1.y + 13), imgui.GetColorU32(imgui.ImVec4(0.46, 0.46, 0.46, 1.00)), 30)
            int.v = i + min
        end
    end
    imgui.SetCursorPosY(position2.y + 18)
    return is_slider_active
end

