function imgui.ImSaturate(f)
    return f < 0.0 and 0.0 or (f > 1.0 and 1.0 or f)
end

function imgui.ToggleButton(name, bool)
	local toggle = false
	if last_active_time == nil then
		last_active_time = {}
	end
	if last_active == nil then
		last_active = {}
	end
    local position1 = imgui.GetCursorScreenPos()
    local position2 = imgui.GetCursorPos()
	local DrawList = imgui.GetWindowDrawList()
    local anim_speed = 0.15
    imgui.SetCursorPosY(position2.y + 2)
	if imgui.InvisibleButton(name, imgui.ImVec2(bool.v and 77 or 86, 25)) then
		bool.v = not bool.v
		toggle = true
		last_active_time[tostring(name)] = os.clock()
		last_active[tostring(name)] = true
    end
	local t = bool.v and 1.0 or -0.3
	if last_active[tostring(name)] then
		local time = os.clock() - last_active_time[tostring(name)]
		if time <= anim_speed then
			local t_anim = imgui.ImSaturate(time / anim_speed)
