function onWindowMessage(msg, wparam, lparam)
	if msg == 0x100 or msg == 0x101 then
		if wparam == 0x1B and settings_menu_state.v and not change_position and not script_information_window.v and not script_settings_window.v and not sampIsChatInputActive() then
			consumeWindowMessage(true, false)
            if msg == 0x101 then
                if list_main.v == 1 then
                    settings_menu_state.v = false
                else
                    list_main.v = 1
                end
            end
        elseif wparam == 0x1B and (script_information_window.v or script_settings_window.v) and not sampIsChatInputActive() then
            consumeWindowMessage(true, false)
            if msg == 0x101 then
                if list_script_information_window.v == 1 then
                    script_information_window.v = false
                    id_lb = nil
                else
                    list_script_information_window.v = 1
                end
                script_settings_window.v = false
            end
        elseif (wparam == 0x1B or wparam == 0x0D) and change_position then
            consumeWindowMessage(true, false)
            if msg == 0x101 then
                sampSetCursorMode(0)
                change_position = false
                settings_menu_state.v = true
            end
        elseif wparam == 0x1B and scoreboard_active_state.v and not sampIsChatInputActive() then
            consumeWindowMessage(true, false)
            if msg == 0x101 then
                scoreboard_active_state.v = false
            end
        elseif wparam == 0x09 and scoreboard_state.v then
            consumeWindowMessage(true, false)
            if msg == 0x101 then
                scoreboard_active_state.v = not scoreboard_active_state.v
			end
        end
    end
end

