function getStrMonth()
    local months = {'января', 'февраля', 'марта', 'апреля', 'мая', 'июня', 'июля', 'августа', 'сентября', 'октября', 'ноября', 'декабря'}
    return months[tonumber(os.date('%m', os.time()))]
end

function formatTime(time)
	time = math.floor(time)
    local timezone_offset = 86400 - os.date('%H', 0) * 3600
	return os.date((os.date('%H', time + timezone_offset) == '00' and '%M:%S' or '%H:%M:%S'), time + timezone_offset)
end

function joinArgb(r, g, b, a)
    local argb = b * 255
    argb = bit.bor(argb, bit.lshift(g * 255, 8))
    argb = bit.bor(argb, bit.lshift(r * 255, 16))
    argb = bit.bor(argb, bit.lshift(a * 255, 24))
    return argb
end

function commaValue(n)
	local left, num, right = string.match(n, '^([^%d]*%d)(%d*)(.-)$')
	return left..(num:reverse():gsub('(%d%d%d)', '%1.'):reverse())..right
end

function getCarSpeed(handle, kmbool)
    local x, y, z = getCarSpeedVector(handle)
    if not x or not y or not z then x, y, z = 0, 0, 0 end
    local kmh = (math.sqrt((x*x) + (y*y) + (z*z)) * 180) / 100
    local mph = (math.sqrt((x*x) + (y*y) + (z*z)) * 180) / 160.9344
    if kmbool then
        return kmh
    else
        return mph
    end
end

function getDistanceToPlayer(id)
	if sampIsPlayerConnected(id) then
        local result, ped = sampGetCharHandleBySampPlayerId(id)
        if result then
            local my_x, my_y, my_z = getCharCoordinates(PLAYER_PED)
            local player_x, player_y, player_z = getCharCoordinates(ped)
            return string.format('%0.1f', getDistanceBetweenCoords3d(my_x, my_y, my_z, player_x, player_y, player_z))
        end
    end
end

