function getStringGameWeather()
    local current_weather = memory.getint8(0xC81320)
    local weather_nums = {
        ['Ясная'] = {0, 1, 2, 3, 5, 6, 10, 11, 13, 14, 17, 18, 23, 24, 25, 26, 27, 28, 29, 34},
