        ['Темная'] = {20, 21, 22, 30, 31, 32, 38, 39, 43, 44, 45},
        ['Штормовая'] = {19}
    }
    for k, v in pairs(weather_nums) do
        for m, n in pairs(v) do
            if n == current_weather then
                return k..' ('..current_weather..')'
            end
        end
    end
    return 'Неизвестно ('..current_weather..')'
end

function getPlayerDirection(handle)
    local angel = math.ceil(getCharHeading(handle))
    if angel then
        if angel > 354 or angel < 6 then
            return 'Север'
        elseif angel < 355 and angel > 275 then
            return 'Северо-запад'
        elseif angel > 264 and angel < 276 then
            return 'Запад'
        elseif angel < 265 and angel > 185 then
            return 'Юго-запад'
        elseif angel > 174 and angel < 186 then
            return 'Юг'
        elseif angel < 175 and angel > 95 then
            return 'Юго-восток'
        elseif angel >= 84 and angel <= 96 then
            return 'Восток'
        elseif angel < 85 and angel > 5 then
            return 'Северо-восток'
        end
    else
        return 'Неизвестно'
    end
end

