-- Автообновление
function checkUpdate()
    updater_spinner = true; updater_state = 1; updater_text = 'Проверка на наличие обновления'
    local json = getWorkingDirectory()..'\\!Custom Interface Update Checker.json'
    if doesFileExist(json) then
        os.remove(json)
    end
    int_json_download = downloadUrlToFile('https://raw.githubusercontent.com/breddlane/CheckingUpdateFiles/master/!Custom%20Interface%20Update%20Checker.json', json, function(id, status, p1, p2)
        if status == dlstatus.STATUSEX_ENDDOWNLOAD and int_json_download == id then
            if doesFileExist(json) then
                local f = io.open(json, 'r')
                if f then
                    local json_info = decodeJson(f:read('*a'))
                    update_link = json_info.update_link
                    latest_version = json_info.latest_version
                    f:close()
                    os.remove(json)
                    if latest_version ~= thisScript().version then
                        updater_spinner = false; updater_state = 2; updater_text = 'Обновление обнаружено! Новая версия: '..latest_version
                        if not settings_menu_state.v then
                            imgui.ShowNotification('Центр обновления', 9, 'Обнаружено обновление!\nОбновиться можно в\nменю настроек', 10)
                        end
                        lua_thread.create(function()
                            while not update_script do wait(100) end
                            updater_spinner = true; updater_state = 3; updater_text = 'Устанавливается обновление...'
                            wait(250)
                            int_script_download = downloadUrlToFile(update_link, thisScript().path, function(id3, status1, p13, p23)
                                if status1 == dlstatus.STATUS_ENDDOWNLOADDATA and int_script_download == id3 then
                                    updater_spinner = false; updater_state = 4; updater_text = 'Обновление установлено! Перезагружаем...'
                                    go_update = true
                                    thisScript():reload()
                                end
                                if status1 == dlstatus.STATUSEX_ENDDOWNLOAD and int_script_download == id3 then
                                    if go_update == nil then
                                        updater_spinner = false; updater_state = 5; updater_text = 'Установить обновление не удалось'
                                        if not settings_menu_state.v then
                                            imgui.ShowNotification('Центр обновления', 9, 'Не удалось установить\nобновление', 5)
                                        end
                                    end
                                end
                            end)
                        end)
                    else
                        updater_spinner = false; updater_state = 4; updater_text = 'У вас актуальная версия'
                    end
                end
            else
                updater_state = 5; updater_text = 'Проверить обновление не удалось'
                if not settings_menu_state.v then
                    imgui.ShowNotification('Центр обновления', 9, 'Не удалось проверить\nобновление. Повторить\nпопытку можно в меню\nнастроек', 10)
                end
            end
        end
    end)
end

